import React, { Component } from 'react';
import Link from "next/link";

class Index extends Component {
    render() {
        return (
            <div>
                <h1>به چت روم آویزون خوش آمدید</h1>
                <Link href='/auth/login'><a>ورود</a></Link>
                <Link href='/auth/register'><a>ثبت نام</a></Link>
            </div>
        );
    }
}

export default Index;
